import './HeaderPage.css'
const NextHeader = ({background,t}) => {
    return ( 
        <div className="next-header" style={
            {backgroundImage:`url(${background})`}}>
              <div className="next-header-title" >
                   <h1></h1>
                  </div>          
            </div>
     );
}
 
export default NextHeader;
